INSERT INTO `v1_d739d58c212908fc4a72a4fe8b3cc36402292ac108bd7b6fff727f8b91f16a9e` VALUES (1110501043, 1110501, 11, 111011, "この蝋燭は、もしや君が作ったのか？\nなに、精油にそんな希少な成分を？\nわざわざぼくの誕生日を祝うために？\n後輩……君という子は……！", 4, 1, 1, 0, 0, "");
