INSERT INTO `v1_d739d58c212908fc4a72a4fe8b3cc36402292ac108bd7b6fff727f8b91f16a9e` VALUES (1110501046, 1110501, 11, 111011, "しかし蝋燭はいいが、この土台部分──\nいや、バースデーケーキとかいう祝祭の\n文化か。ううむ気持ちは有難いが、\n食の細いぼくには若干拷問サイズだ……", 4, 1, 1, 0, 0, "");
